import React from 'react';

import './App.css';
import {tweets} from '../../constants';
import Tweet from '../../components/Tweet';


console.log(tweets);
const App = () => (

    <main id="main">

        tweets.map((tweet, index) =>
            <Tweet
            
            
            
            
            />

        )
               
        <Tweet 
            avatar =  {tweets[0].avatar}
            fullname = {tweets[0].fullname}
            date = {tweets[0].date}
            content = {tweets[0].content}    
        />
        <Tweet 
            avatar =  {tweets[1].avatar}
            fullname = {tweets[1].fullname}
            date = {tweets[1].date}
            content = {tweets[1].content}    
        /><Tweet 
            avatar =  {tweets[2].avatar}
            fullname = {tweets[2].fullname}
            date = {tweets[2].date}
            content = {tweets[2].content}    
        />
        
      
    </main>

);

export default App;
